-- --------------------------------------------------
-- PROCESS TO REGISTER ADDRESS INPUT AND DATA OUTPUT ON CLOCK EDGE
-- --------------------------------------------------
DATA_PROC : process(RST, CLK) is
begin

if RST='1' then
    DATA_OUT <= (others => '0');
    ADDR <= (others => '0');
elsif rising_edge(CLK) then
    DATA_OUT <= std_logic_vector(DATA);
    ADDR <= ADDR_IN;
end if;

end process;
end architecture RTL;
